import React from 'react';

const SuperViewFrom = React.memo(function ({columns, item}) {

    return <tbody>
        {columns.map((col)=><tr>
            <td>{col}</td>
            <td>{/*item[col]*/}</td>
        </tr>)}
    </tbody>
});

export default SuperViewFrom;
